- input: "TEXT\x1CC00157537\x1C.TEXT\x1C\x1CF24\x1CI noticed as I was preparing a
    State PAC report and in looking over the 24 hour notice for 5/10/2010 that I had
    not dispersed the amounts owed between all federal candidates for West Virginia,
    but only the two who were reported on the 5/10/2010 24 hour notice.  I also noticed
    that some of the items reported needed to be reported on different dates, the
    date we were invoiced, not the date paid, so corrections were made.  There were
    also some items missed on the original report.  This 24 hour notice will replace
    the one filed on 5/10/2010 that had replaced the original report on 5/4/2010.\n"
